import Head from "next/head";
import { Box, Container, Grid, Pagination } from "@mui/material";
// import { products } from "../../__mocks__/products";
import { ProductListToolbar } from "./product/product-list-toolbar";
import { ProductCard } from "./product/product-card";
import { DashboardLayout } from "../dashboard/dashboard-layout";
import { useEffect, useState } from "react";
import ValueServices from "../../services/ValueServices";

const Products = () => {
  const [expedientes, setExpedientes] = useState([]);

  useEffect(() => {
    ValueServices.getExpedientes().then((response) => {
        console.log(response.data);
      setExpedientes(response.data);
    });
  }, []);

  return (
    <DashboardLayout>
      <Head>
        <title>Products | Material Kit</title>
      </Head>
      <Box
        component="main"
        sx={{
          flexGrow: 1,
          py: 8,
        }}
      >
        <Container maxWidth={false}>
          <ProductListToolbar />
          <Box sx={{ pt: 3 }}>
            <Grid container spacing={3}>
              {expedientes.map((expediente) => (
                <Grid item key={expediente.id} lg={4} md={6} xs={12}>
                  <ProductCard expediente={expediente} />
                </Grid>
              ))}
              {/* {products.map((product) => (
                <Grid item key={product.id} lg={4} md={6} xs={12}>
                  <ProductCard product={product} />
                </Grid>
              ))} */}
            </Grid>
          </Box>
          {/* <Box
            sx={{
              display: "flex",
              justifyContent: "center",
              pt: 3,
            }}
          >
            <Pagination color="primary" count={3} size="small" />
          </Box> */}
        </Container>
      </Box>
    </DashboardLayout>
  );
};

export default Products;
